class Solution {

    /**
     * @param Integer[][] $grid
     * @return Integer
     */
    function findChampion($grid) {
        $n = count($grid);
        for ($i = 0; $i < $n; $i++) {
            $isChampion = true;
            for ($j = 0; $j < $n; $j++) {
                if ($i != $j && $grid[$i][$j] == 0) {
                    $isChampion = false;
                    break;
                }
            }
            if ($isChampion) {
                return $i;
            }
        }
        return -1; // Return -1 if no champion is found, though the problem constraints make this unlikely
    }
}
